import React from 'react';
import { Link } from 'react-router-dom';

const ElementsPage = () => {
    return(
            <main>
                <div className="all_elements--button button-margin_top" id='ordinary--button'>
                  <Link to="/MainPage">
                    <button>
                      Home Page
                    </button>
                  </Link>
                </div>
            </main>
    )
}   

export default ElementsPage;
